INSERT INTO `phim` VALUES (2,'SPIDER MAN : NO WAY HOME',148,'Hành động','Mỹ',2021,'file:/C:/ND/workspace/Java/Movie%20Management%20System/quanlyrapphim/src/main/resources/image/spidermanPoster.jpeg','file:/C:/ND/workspace/Java/Movie%20Management%20System/quanlyrapphim/src/main/resources/video/SPIDER-MAN_%20NO%20WAY%20HOME%20-%20Official%20Trailer%20(HD).mp4','Danh tính Người Nhện bị Mysterio tiết lộ, khiến cuộc sống của Peter Parker gặp nhiều khó khăn. Anh phải đối mặt với sự soi mói của dư luận, sự nghi ngờ của bạn bè và gia đình, và cả những nguy hiểm rình rập từ những kẻ thù cũ. Trong lúc bế tắc, Peter tìm đến Doctor Strange, hy vọng phép thuật sẽ giúp anh che giấu danh tính và khôi phục lại cuộc sống bình thường. Tuy nhiên, mọi chuyện không hề suôn sẻ như dự tính. Phép thuật của Doctor Strange vô tình mở ra cánh cổng đa vũ trụ, dẫn đến sự xuất hiện của những kẻ thù nguy hiểm từ các vũ trụ khác, bao gồm Green Goblin (Willem Dafoe), Doc Ock (Alfred Molina), Electro (Jamie Foxx), Sandman (Thomas Haden Church) và Lizard (Rhys Ifans).'),(3,'AVENGERS : END GAME',180,'Hành động','Mỹ',2019,'file:/C:/ND/workspace/Java/Movie%20Management%20System/quanlyrapphim/src/main/resources/image/AvengerPoster.jpg','file:/C:/ND/workspace/Java/Movie%20Management%20System/quanlyrapphim/src/main/resources/video/Marvel%20Studios\'%20Avengers_%20Endgame%20-%20Official%20Trailer.mp4','Biệt đội Avengers - những anh hùng còn sót lại sau thảm họa diệt vong - tập hợp một lần nữa. Mang theo niềm hy vọng mong manh, họ quyết tâm đảo ngược hành động tàn ác của Thanos, kẻ thù hùng mạnh đã suýt xóa sổ cả thế giới. Trận chiến cam go sắp sửa diễn ra, hứa hẹn sẽ mang đến những khoảnh khắc nghẹt thở và đầy cảm xúc.');
/*!40000 ALTER TABLE `phim` ENABLE KEYS */;
